* Pel·lícula d'oli; 
* Pel·lícula de passivació; 
* Estany lliure; 
* Aliatge Fe Sn2; 
* Acer lliure. Mentre la llauna va ser un element habitual per a la fabricació d'eines de cuina, joguines, parament, etc. la professió de llauner era molt habitual. La seva facilitat de maneig és òbvia, ja que pot ser tallada amb tisores d'una manera i mides específiques.

